	(1, 1, '관리자 / CLI 접근제어 설정 여부 확인', '', NULL, NULL, NULL, '권한 관리'),
	(2, 1, '관리 인터페이스 분리 여부', '일반 사용자와 관리자 서비스 분리 / 일반 사용자가 중요기능 설정에 접근할 수 없도록 사용 권한 최소화', NULL, NULL, NULL, '권한 관리'),
