	(6, 1, 'Apache 웹 프로세스 권한 제한', 'Apache 서비스를 사용하는지? / Apache 서비스에 대한 권한제어', NULL, NULL, NULL, '권한 관리'),
	(7, 1, 'Apache 상위 디렉토리 접근 금지', 'Apache 서비스를 사용하는지? / 인가된 사용자만 특정 디렉토리 접근 및 열람 가능하도록 설정', NULL, NULL, NULL, '권한 관리'),
	(8, 1, 'ftp 계정 shell 제한', '기본 생성된 FTP 계정에 /bin/false 쉘이 설정되어있는지를 확인', NULL, NULL, NULL, '권한 관리'),
	(9, 1, 'ftpusers 파일 소유자 및 권한 설정', '"FTP 접근제어 설정파일 권한 변경 (소유자 root', NULL, NULL, NULL, '권한 관리'),
