	(19, 1, 'TCP/UDP Small 서비스 차단', '"IOS 기기 버전따라 다른데', NULL, NULL, NULL, '상태 관리'),
	(20, 1, '불필요한 서비스 제거', '출처로 언급된 자료가 존재하지 않음 /  사용하지 않는 서비스 제거를 의미하는것 같음', NULL, NULL, NULL, '상태 관리'),
	(21, 1, '불필요한 서비스 제한 및 보안 설정', '출처로 언급된 자료가 존재하지 않음 /  사용하지 않는 서비스 제한을 의미하는 것 같음', NULL, NULL, NULL, '상태 관리'),
	(22, 1, '불필요한 서비스 및 포트 통제', '"예시로 TCP', NULL, NULL, NULL, '상태 관리'),
	(23, 1, 'Bootp 서비스 차단', 'Bootp 서비스 : 네트워크를 이용하여 사용자가 OS를 로드할수 있게하고 자동으로 IP를 받음', NULL, NULL, NULL, '상태 관리'),
	(24, 1, 'CDP 서비스 차단', '"CDP : Cisco Discovery Protocol', NULL, NULL, NULL, '상태 관리'),
	(25, 1, 'Directed-broadcast 차단', 'IP Directed-Broadcast 서비스를 사용하면 Smurf 공격에 노출된다고 함.', NULL, NULL, NULL, '상태 관리'),
	(26, 1, 'Source 라우팅 차단', 'ip spoofing 차단 / 각 인터페이스 별로 ip source route 제한 설정', NULL, NULL, NULL, '상태 관리'),
	(27, 1, 'Proxy ARP 차단', '"ARP Proxy: 게이트웨이를 가지고 있지 않은 네트워크의 호스트들에게 arp 서비스를 제공하는 역할', NULL, NULL, NULL, '상태 관리'),
	(28, 1, '"ICMP unreachable', ' Redirect 차단"', NULL, NULL, NULL, '상태 관리'),
	(29, 1, 'identd 서비스 차단', 'identd 서비스 : 네트워크 장비에 접속을 요청한 사용자에 대한 신원확인으로 씀', NULL, NULL, NULL, '상태 관리'),
